import React from 'react';
import VideoItem from './VideoItem';

const VideoList = ({ videos }) => {
  videos.map((video) => {
    return (
      <div>
        <VideoItem video={video} />
      </div>
    );
  });
  // const videos = props.videos.map((video) => {
